const SERVICE_WORKER_SCRIPT="/sw.js";const SERVICE_WORKER_SUCCESS_MSG="--- Service Worker registered successfully ---";const SERVICE_WORKER_ERROR_MSG="*** Service Worker registration failed ***";const TAB_SELECTOR=".tabs";const TAB_CONTENT_SELECTOR=selectedTabId=>`#${selectedTabId}-content`;const registerServiceWorker=()=>{navigator.serviceWorker.register(SERVICE_WORKER_SCRIPT).then((()=>console.log(SERVICE_WORKER_SUCCESS_MSG))).catch((error=>console.error(SERVICE_WORKER_ERROR_MSG,error)))};document.addEventListener("DOMContentLoaded",(()=>{const sidenavElements=document.querySelectorAll(".sidenav");const initializeRightSidenav=element=>{const edge=element.classList.contains("right")?"right":"left";M.Sidenav.init(element,{edge:edge})};sidenavElements.forEach(initializeRightSidenav);const initializeCollapsible=()=>{const collapsibleElements=document.querySelectorAll(".collapsible");M.Collapsible.init(collapsibleElements)};initializeCollapsible();const modalOptions={inDuration:150,outDuration:150,opacity:1};const initializeModals=()=>{const modalElements=document.querySelectorAll(".modal");const modalInstances=M.Modal.init(modalElements,modalOptions);return modalInstances};initializeModals();const handleTabShow=tab=>{const selectedTabId=tab.getAttribute("id");const tabContent=document.querySelector(TAB_CONTENT_SELECTOR(selectedTabId));if(tabContent){tabContent.classList.add("active")}};const initializeTabs=()=>{const tabs=document.querySelectorAll(TAB_SELECTOR);return M.Tabs.init(tabs,{swipeable:true,onShow:handleTabShow})};initializeTabs();const initializeSelectElements=()=>{const selectElements=document.querySelectorAll("select");return M.FormSelect.init(selectElements,{})};initializeSelectElements();M.Forms.InitFileInputPath(document.querySelector(".file-input"));const CURRENT_DATE=new Date;const MIN_WORKING_AGE=12;const MAX_WORKING_AGE=65;const MAX_WORKING_YEAR=CURRENT_DATE.getFullYear()-MIN_WORKING_AGE;const MIN_WORKING_YEAR=CURRENT_DATE.getFullYear()-MAX_WORKING_AGE;const initializeDatepicker=()=>{const datepickerElements=document.querySelectorAll(".datepicker");return M.Datepicker.init(datepickerElements,{autoClose:true,format:"yyyy-mm-dd",yearRange:[MIN_WORKING_YEAR,MAX_WORKING_YEAR],yearRangeReverse:true,showClearBtn:true,i18n:{done:"Select"}})};initializeDatepicker();const initializeTooltips=()=>{const tooltipElements=document.querySelectorAll(".tooltipped");return M.Tooltip.init(tooltipElements,{})};initializeTooltips()}));